import React, { useState, useEffect } from 'react';

function List(props) {
    return (
        <>
        {props.items.map((movie, index)=> (
          <div className="items">
            <img src={movie.Poster} alt='movie'></img>
          </div>
        ))}
      </>
    )
}

export default List;
